import React from 'react';
import './Header.css';

import RandomVideo from '../RandomVideo/RandomVideo';


class Header extends React.Component {
  render() {
    return (
    	<div className="header">
	    	<h1 style="font-size: 50px">The Liu Family's Video Gallery</h1>
	    	<p>A collection of the Liu family's home videos throughout the years</p>
	    	<RandomVideo />
    	</div>
    );
  }
}

export default Header;
